import React from 'react'
import ReactDOM from 'react-dom'
import App from './app'


let myPosts = [
    {
        id: '1',
        from: 'Elena',
        message: 'It is first post',
        date: '25.06.20',
        like: '25'
    },
    {
        id: '2',
        from: 'Alice',
        message: 'Today is funny day',
        date: '25.06.20',
        like: '28'
    },
    {
        id: '3',
        from: 'Elena',
        message: 'Today is boring day',
        date: '26.06.20',
        like: '8'
    }
]

ReactDOM.render(<App myPosts={myPosts}/>, document.getElementById('root'))
